import React, { useEffect, useState } from "react";
const Vans = () => {
  const [data, setData] = useState([]);
  const [loading, setLoading] = useState(true);

  useEffect(() => {
    fetch("/api/vans")
      .then((res) => res.json())
      .then((data) => setData(data.vans));
  }, []);

  return (
    <div className="data">
      {data.map((item) => {
        const { title } = item;
        return (
          <div className="item">
            <div className="" key={item.id}>
              {title}
            </div>
          </div>
        );
      })}
    </div>
  );
};

export default Vans;
